import React, { Component } from "react";
import { v4 } from "uuid";

class Cars extends Component {
  constructor() {
    super();
    this.state = {
      cars: [
        { id: "ferrari", name: "Ferrari" },
        { id: "benz", name: "Benz" },
        { id: "bmw", name: "BMW" },
        { id: "lombor", name: "Lombor" },
        { id: "ford", name: "Ford" },
      ],
    };
  }
  render() {
    const { cars } = this.state;
    return (
      <div>
        <h1>My Cars:</h1>
        {cars.map((car) => (
          //Set key By Usin from id
          //   <p key={car.id}>A car from {car.name} company</p>

          //Set Key By Using uuid Package
          <p key={car.id}>A car from {car.name} company</p>
        ))}
      </div>
    );
  }
}

export default Cars;
